	function getShowCardNo(){
		var cardNo=$$("input[name=cardNo]").val().replace(/\s/g,'');
		var returnCardNo ="";
		for(var i=0;i<cardNo.length;i++){
			if((i+1)%4==0&&i!=cardNo.length-1){
				returnCardNo += cardNo.substring(i,i+1)+" ";
			}else{
				returnCardNo += cardNo.substring(i,i+1);
			}
		}
		$$("input[name=cardNo]").val(returnCardNo)
	}

