	/**
	 * 解析图片 url
	 * 
	 * @param {Object}
	 *            json
	 */
	function parsePicUrl_depository(json){// HJL_TAG 删除银行卡处理
		var obj = eval('(' + json + ')');
		var errNo = obj.errorNo;
		if (errNo === 0) {
			// 解析返回的图片地址url
			var url = obj.src;
			var succBankPinyin = obj.picType.split("Div")[0];
			var index = hasAExistedBankPic(succBankPinyin);
			if(index!=-1){
				APP_thirdBank.bankPicCode[index] = succBankPinyin;
			}else{
				APP_thirdBank.bankPicCode.push(succBankPinyin);
			}
			APP_thirdBank.hasBankCardPic = true;
// APP_thirdBank.bankPicCode =
			View.showPhotoFront(url);
			APP_thirdBank.frontPicUploaded = "4";
		} else {
			khApp.alert(obj.errorInfo);
		}
	}
	window.parsePicUrl_depository = parsePicUrl_depository;
