	// 提交添加
	function submitOrNext(){
		var bindUrl = "";
		if(APP_thirdBank.isReBind == "1"){	// 重新绑定
			bindUrl = '/reBind.do?rnd=' + new Date().getTime();
		}else{
			bindUrl = '/bind.do?rnd=' + new Date().getTime();
		}
		console.log(bindUrl);
		// 字符串拼接
		var bankCodes = "";
		var bankAccounts = "";
		var bankBranchs = "";
		for(var i=0;i<APP_thirdBank.bankCards.length;i++){
			bankCodes = bankCodes+APP_thirdBank.bankCards[i].bankCode+",";
			bankAccounts = bankAccounts+APP_thirdBank.bankCards[i].bankAccount+",";
			if(!APP_thirdBank.bankCards[i].bankBranch){
				APP_thirdBank.bankCards[i].bankBranch = "null"
			}
			bankBranchs = bankBranchs+APP_thirdBank.bankCards[i].bankBranch+",";
		}
		//
		khApp.showIndicator();
		$$.ajax({      // /MadeByHJL 提交银行卡号处理
			url: bindUrl,
			type: 'POST',
			timeout: 15000, // 超时时间设置，单位毫秒
			data:{ 
				bankCodes:bankCodes,
				bankAccounts:bankAccounts,
				bankBranchs:bankBranchs
				},
			success: function (data) {
				khApp.hideIndicator();
				var data = JSON.parse(data);
				if (data.errorNo == 0) {
					CRHloadPage(APP_thirdBank.next);
				} else {
					khApp.alert(data['errorInfo']);
					$$('.depository-next-button').prop('disabled', false);
				}
			},
			error: function(){
				khApp.hideIndicator();
	   			khApp.alert(MESSAGE_TIMEOUT);
	   			$$('.depository-next-button').prop('disabled', false);
	   		},
	   		timeout: function(){
	   			khApp.hideIndicator();
	   			khApp.alert(MESSAGE_TIMEOUT);
	   			$$('.depository-next-button').prop('disabled', false);
	   		}
		});
	}
