	function hasAExistedBankCard(){
		if(APP_thirdBank.bankCards.length==0){
			return -1;
		}
		for( var i=0;i< APP_thirdBank.bankCards.length;i++){
			var bank_no = APP_thirdBank.bankCards[i].bankCode;
			if(bank_no==APP_thirdBank.BankCode){
				return i;
			}
		}
		return -1;
	}
