	//银行网点只需要一个  ,删除银行卡、覆盖银行卡、添加银行卡完成后都需要重置银行卡网点状态
	function hasBankBranch(){
		for(var i=0;i<APP_thirdBank.bankCards.length;i++){
			var app_bankBranch = APP_thirdBank.bankCards[i].bankBranch;
			if(!(app_bankBranch==""||app_bankBranch=="undifined")){
				APP_thirdBank.hasBankCardAdd = true;
				break;
			}
			if(i == APP_thirdBank.bankCards.length-1&&(app_bankBranch==""||app_bankBranch=="undifined")){
				APP_thirdBank.hasBankCardAdd = false;
			}
		}
	}
	//从缓存数组中删除照片索引，实际上照片是由后台删除处理的 返回拼音。-1：没有
	function deletBankPicFromArray(pinYin){
		if(APP_thirdBank.bankPicCode.length<=0){
			return "NULL";
		}else{
			for(var i=0;i<APP_thirdBank.bankPicCode.length;i++){
				var bank_pinyin = APP_thirdBank.bankPicCode[i];
				if(pinYin==bank_pinyin){
					APP_thirdBank.bankPicCode.splice(i,1);
					return bank_pinyin;
				}
			}
		}
		return "NULL";
	}
	function deletBankFromArray(bankCode){
		if(APP_thirdBank.bankCards.length<=0){
			return false;
		}else{
			for(var i=0;i<APP_thirdBank.bankCards.length;i++){
				var app_bankCode = APP_thirdBank.bankCards[i].bankCode;
				if(app_bankCode==bankCode){
					APP_thirdBank.bankCards.splice(i,1);
					APP_thirdBank.bandLengthFlag = true;
					return true;
				}
			}
		}
		return false;
		
	}
	function initBankData(){
		APP_thirdBank.bankCards = [];
		APP_thirdBank.bankPicCode = [];
	}
	
